(104, 'Hng dn s dng Mchose GX87', 'huong-dan-su-dung-mchose-gx87', '<p>Nihao! <a href=\"https://kicap.vn/mchosegx87-ban-phim-co-khung-nhom-tkl-3-mode-co-ta\">Mchose GX87</a> l mt trong nhng chic bn phm ngon  phn khc. Vi thit k layout TKL, n nn RGB, 3 ch ,.... Mchose GX87 chc chn s lm ngi dng thy tha mn khi s dng. KICAP rt hn hnh c ng hnh cng Mchose mang ti sn phm ny ti tay ngi dng.</p><p>Hng cng cung cp mt quyn s hng dn s dng chi tit vi rt nhiu th ting. Tuy nhin  tin theo di v s dng, KICAP s tm tt li nhng tip s dng chnh cho mi ngi d hiu.</p><p>&nbsp;</p><blockquote><strong>Tuyn b trch nhim</strong>: <em>Bi vit ny ch hng dn cho anh em cch s dng bn phm. KICAP ch tip nhn v gii p nhng thc mc v li bn phm khi mi ngi mua bn phm bn shop KICAP</em><em>Tt c cc sn phm mua  bn ca hng khc qu khch vui lng lin h trc tip vi h  c phc v.</em><em>Cc n hng qu khch mua trn sn tmt nh shopee, lazada, tiktok vui lng inbox trc tip cho gian hng trnh lin h nhm ca hng nh!</em><em>Trn trng cm n anh em &lt;3</em></blockquote><p>&nbsp;</p><p><strong><em>I. Ci t phn mm, driver&nbsp;</em></strong></p><p><strong>Link ti phn mm cho window: </strong><a href=\"https://1drv.ms/u/c/4369e28698355db0/EZBb70DA8UFBv_APRsACIicB1Uh0r2Czl0RxLEFVecrlfg?e=Owft5Q\"><strong><em>Mchoose Hub</em></strong></a></p><p>Sau khi ti phn mm, cc bn kt ni bn phm vi my tnh qua dy cp USB ca hng cung cp (khng kt ni bng bluetooth hoc wireless 2.4). Sau , bt phn mm ln v thc hin chnh LED cng nh keymap theo nhu cu s dng ca c nhn. Trong trng hp c phin bn firmware mi th cc bn cn m bo kt ni dy USB n nh th mi cp nht.</p><p><strong><em>II. iu chnh ch  kt ni vi cc thit b</em></strong></p><p><strong>Kt ni Bluetooth (gt cng tc  mt di bn phm sang B):</strong></p><p><strong> </strong>Nhn v gi ng thi phm FN + W trong 3 giy.</p><p><strong></strong> M thit b cn kt ni Bluetooth (chng hn nh in thoi di ng, my vi tnh).</p><p><strong></strong> Tm tn GX87 3.0 hoc GX87 5.0 v kt ni.</p><p><strong>Kt ni Wireless 2.4G (gt cng tc  mt di bn phm sang 2.4G):</strong></p><p>Hng thit k ch  u thu wireless  ngay  cnh ch cng tc BT</p><p>Cm u thu vo cng USB my tnh l c th s dng c ri.</p><p><strong>Kt ni bng dy (gt cng tc  mt di bn phm v v tr gia OFF):</strong></p><p>Cm dy v s dng.</p><p><strong>I</strong><strong><em>I. Cc t hp phm tt thng dng</em></strong></p><p><strong>F</strong>N + A : Ch  Mac</p><p><strong>F</strong>N + S : Ch  Win</p><p><strong>F</strong>N + ESC: reset li phm</p><p><strong>F</strong>N + WIN (bn tri): Kho hoc m kho phm WIN&nbsp;</p><p><strong>F</strong>N + += :&nbsp; Thay i ch  LED trn bn phm</p><p><strong>F</strong>N + _- : Thay i mu LED&nbsp;</p><p><strong>F</strong>N + iu hng ln: Tng  sng LED</p><p><strong>F</strong>N + iu hng xung: Gim  sng LED</p><p><strong>F</strong>N + iu hng tri: Gim tc  nhy LED</p><p><strong>F</strong>N + iu hng phi: Tng tc  nhy LED&nbsp;</p><p><strong>F</strong>N + /? : i mu LED trng thi</p><p><strong>F</strong>N + ,&lt; : Tng  sng LED trng thi</p><p><strong>F</strong>N + .&gt; : Gim  sng LED trng thi</p><p><strong>F</strong>N + Shift phi : i ch  sng LED trng thi</p><p><strong>F</strong>N + Shift tri : i LED trng thi sang ch  sc</p><p><strong><em>IV. Cc TIPS v lu  nh trong qu trnh s dng</em></strong></p><p>Khi thy nt Alt v Win i ch cho nhau tc l bn  ch  MAC</p><p><strong>Lu :</strong> lun lun sc bn phm thng qua cng USB ca my tnh, khng sc bng ci c sc khc nh sc d phng, sc laptop, tai nghe, in thoi v.v</p><p><strong>Cn nu bn l ngi mi chi, cha tm hiu nhiu v bn phm cng nh cch mods phm c, hay inbox cho Kicap  c t vn c th nhit tnh nht. Zi jin!</strong></p>', 'Nihao! Mchose GX87 l mt trong nhng chic bn phm ngon  phn khc. Vi thit k layout TKL, n nn RGB, 3 ch ,.... Mchose GX87 chc chn s lm ngi dng thy tha mn khi s dng. KICAP rt hn hnh c ng hnh cng Mchose mang ti sn phm ny ti tay ngi dng.', '01JA9GE3V3ST7BKQXT3W2969M5.png', '2024-10-16 01:52:46', '2024-10-16 01:52:46'),
