(1, '183 HT44 phng Hip Thnh Qun 12', '0355198659', 'bqhuy.pf@gmail.com', 'The BABU Store', ' Copyright 2024 | THE BABU | All Rights Reserved', '01JBZXMG80MWVRMB0W7AWSW0WE.svg', '<p>Quy nh ny c lp ra vi mc ch nu r cc iu khon, quyn li, ngha v v trch nhim ca ngi mua v ngi bn khi s dng cc dch v c cung cp ti trang web Webgiadung.com<br><br><strong>1. i vi ngi bn:</strong><br>+ Cam kt bn cc sn phm cht lng<br>+ Cam kt bo mt thng tin ca khch hng, khng tit l cho bn th 3.<br>+ Cam kt bo hnh trong thi gian bo hnh, li 1 i 1 nu li thuc v nh sn xut.<br>+ Bo m qu trnh mua hng &amp; thanh ton ca khch hng din ra an ton.<br> <br><strong>2.&nbsp; i vi ngi mua:</strong><br>+ Ngi mua c trch nhim thanh ton y  tin hng, ph vn chuyn (nu c) cho sn phm  chp nhn mua hng &amp; thanh ton.<br>+ Cam kt ch mua hng phc v cho nhu cu &amp; mc ch c nhn, phi mu dch, theo Quy nh ca Php lut Vit Nam.<br>+ Tm hiu k cng thng tin v sn phm, hng ha mun t mua trc khi chp nhn mua hng &amp; thanh ton, trnh trng hp khng ng nhu cu.<br>+ Khch hng c php khiu ni v yu cu bo hnh, i  tr hng ha nu hng ha nhn thuc v li ca nh sn xut trong thi gian bo hnh quy nh.<br><br><strong>iu kin bo hnh:</strong><br><br>+ Sn phm cn nguyn tem, nhn mc, bao b v ph kin km theo.<br><br>+ Li sn phm do linh kin hoc do nh sn xut.<br><br> Lu  , chng ti khng nhn bo hnh trong cc trng hp sau:<br><br>+ Sn phm b xy xt, rch, v, try xc do khch hng s dng khng ng cch, nh ri, lm v.<br><br>+ Sn phm b chp, chy dy, linh ph kin do khch hng khng s dng ng cch theo hng dn ca nh sn xut.<br><br>+ Sn phm  qu thi gian bo hnh i tr.<br><br>Chnh Sch i Tr Hng Khi Mua Hng Ti Webgiadung.com<br><br> m bo s hi lng ca khch hng khi mua sm ti Webgiadung.com, Webgiadung.com nhn i tr hng hoc bo hnh li 1 i 1 trong vng 7 ngy k t khi khch hng nhn sn phm (i sn phm mi trong trng hp khng sa cha c).<br><br><strong>iu kin i tr:</strong><br><br>+ Sn phm cha qu s dng, cn nguyn tem, nhn mc, bao b v ph kin km theo.<br><br>+ Li sn phm do linh kin hoc do nh sn xut</p>', '<p>HNG DN MUA HNG<br>Bc 1: Truy cp website v la chn sn phm cn mua  mua hng<br>Bc 2:&nbsp; Click v sn phm mun mua, mn hnh hin th ra pop up vi cc la chn sau:<br>Nu bn mun tip tc mua hng: Bm vo phn tip tc mua hng  la chn thm sn phm vo gi hng<br>Nu bn mun xem gi hng  cp nht sn phm: Bm vo xem gi hng<br>Nu bn mun t hng v thanh ton cho sn phm ny vui lng bm vo: t hng v thanh ton<br>Bc 3: La chn thng tin ti khon thanh ton<br>Nu bn  c ti khon vui lng nhp thng tin tn ng nhp l email v mt khu vo mc  c ti khon trn h thng<br>Nu bn cha c ti khon v mun ng k ti khon vui lng in cc thng tin c nhn  tip tc ng k ti khon. Khi c ti khon bn s d dng theo di c n hng ca mnh<br>Nu bn mun mua hng m khng cn ti khon vui lng nhp chut vo mc t hng khng cn ti khon<br>Bc 4: in cc thng tin ca bn  nhn n hng, la chn hnh thc thanh ton v vn chuyn cho n hng ca mnh<br>Bc 5: Xem li thng tin t hng, in ch thch v gi n hng<br>Sau khi nhn c n hng bn gi chng ti s lin h bng cch gi in li  xc nhn li n hng v a ch ca bn.<br>Trn trng cm n.</p>', '<p><strong>1 - Giao hng v thanh ton bng tin mt ti nh:</strong><br>- Cc yu cu giao hng ti nh cn c thng tin chnh xc v ngi nhn, a ch, s in thoi. Mt s trng hp nhy cm nh: gi tr n hng ln, thi gian giao hng bui ti, a ch giao hng trong ng, khu vc xa trung tm.. Nhn vin bn hng s kim tra v tho thun thm, thng nht cch thc giao hng c th.</p><p><strong>2 - Thanh ton chuyn khon ngn hng - giao hng qua dch v chuyn pht nhanh:</strong></p><p>- Vi cc a ch khng thuc phm vi nu trn, khch hng c th thanh ton trc 100% gi tr sn phm qua mt trong cc ti khon ca BABU.<br>- Ngay sau khi nhn c tin thanh ton qua chuyn khon, nhn vin t vn s gi in thng bo trc tip ti khch hng v hn ngy gi giao hng. Tu theo a ch ca khch hng m thi gian giao hng c th t 12 n 72 gi.<br>- Trong trng hp giao hng chm tr m khng bo trc, khch hng c th hu n hng v BABU s hon tr ton b s tin m khch hng  tr trong thi gian 07 ngy.<br>- Sn phm c gi tr bao gm thu Gi tr gia tng trn 20 triu VN, theo Lut thu GTGT do Nh nc ban hnh cn thanh ton chuyn khon. Khch hng c th gi cho nhn vin  c t vn chi tit ti y.</p><p><strong>3 - Giao hng v thanh ton trc tip ti Showroom/i l ca BABU:</strong></p><p>- Khch hng c th yu cu gi hng ti store BABU.<br>- Sn phm s c chun b y  sau khng qu 04 gi, v c gi li ti ca hng khng qu 12 gi k t khi nhn vin t vn bn hng xc nhn n t hng ca khch hng.</p><p><strong>4 - Ph vn chuyn + ph bo him sn phm:</strong></p><p>- Ph vn chuyn: Min ph ton quc nu l n hng 800k tr ln, tnh ph i vi cc mt hng khc hoc ty theo tha thun.<br>- Ph bo him sn phm: i vi cc sn phm khi chuyn hng thng qua bn th 3 l cng ty c k hp ng vn chuyn vi BABU, khch hng thanh ton khon ph bo him sn phm ty theo gi tr ca sn phm. Trong qu trnh vn chuyn nu xy ra hng hc, mt mt, khch hng s c n b 100% gi tr sn phm ti thi im xut bn nu ng bo him.<br><strong>5 - Cc trng hp khc:</strong></p><p>- Khch hng c yu cu chuyn hng qua bn th 3 khc nh nh xe, ngi quen, hoc n v vn chuyn khng k hp ng trc tip vi BABU. Chi ph v mi ri ro trong qu trnh vn chuyn do khch hng chu. Khi nhn vin giao hng BABU bn giao sn phm cho bn th 3, th khch hng v i tc vn chuyn ca khch hng cn xc nhn bng in thoi, tin nhn SMS hoc trn phiu xut hng ca BABU.</p>', '<h1>I. Chnh sch vn chuyn</h1><p>- Giao hng min ph trn ton quc i vi sn phm trn 800 nghn ng</p><p>i vi khch hng  ngoi tnh hoc c yu cu chuyn pht th chng ti s chuyn pht nhanh n tn ni cho khch hng.</p><p>- Giao hng c ph vn chuyn vi cc n di 800 nghn ng, ng gi 30K</p><p>II. Hiu lc</p><p>Chnh sch ny khng p dng i vi hng ha l qu tng, hng khuyn mi. Cc chng trnh khuyn mi khng p dng ng thi (nhng khng bao gm khuyn mi  mc I ca chnh sch ny), u tin khuyn mi ln nht dnh cho khch hng ti thi im giao dch.</p><p>III. Thi gian giao hng</p><p>Thi gian giao hng ti Ni thnh H Ch Minh t 3-10 gi ng h tnh t thi im xc nhn n hng vi khch hng.<br>Thi gian giao hng COD  cc tnh, thnh ph s tu thuc vo tng a ch ca khch hng, b phn x l n hng s bo c th vi khch hng (Trung bnh khong 2  5 ngy lm vic)<br>Trong trng hp khch hng cn vn chuyn HA TC th qu khch vui lng trao i vi nhn vin bn hng s t vn c th.</p><p>Cc trng hp c bit, khch hng vui lng lin h vi hotline 0355198659</p><p>Lu : Vo thi gian cao im (l, tt), hoc ty theo mt s iu kin khch quan (nh thin tai, hng hc phng tin, v.v), chng ti khng th giao hng ngay nn s tha thun thi gian giao hng c th cho qu khch.</p><p>Xin chn thnh cm n qu khch hng  tin cy v s dng dch v ca chng ti!</p><p><br></p>', '<p><strong>BABU</strong> bo hnh qua s in thoi t hng ca qu khch. K t khi xut kho, h thng s t to phiu bo hnh cho sn phm ca qu khch theo thi gian bo hnh  thng bo trn website (tr cc sn phm khng s dng in nh keycap, nm xoay, dng s mods, switch, v.v.v)</p><p><strong>A. a im bo hnh:</strong></p><p>- Ton b sn phm c phn phi v bn l bi BABU u c bo hnh ti a ch ca BABU</p><p>- i vi nhng n hng mua hng t xa, qu khch vui lng gi in, nhn tin qua Fanpage, Shopee, Zalo  c BABU h tr xc nh tnh trng sn phm</p><p>- Vi cc trng hp bo hnh t xa, quy trnh bo hnh thc hin nh sau:</p><p>+ Qu khch vui lng ng gi k sn phm  m bo an ton khi vn chuyn hng. THE BABU s khng chu trch nhim khi c cc li pht sinh do qu trnh vn chuyn.</p><p>+ Bn ngoi kin hng vui lng ghi Tn, ST v a ch ca qu khch  shop tin lin lc v gi hng li.</p><p>- Gi sn phm v a ch ca BABU . Chi ph chuyn pht chiu gi i qu khch vui lng t thanh ton.</p><p>- Sau khi bo hnh xong, BABU s lin h gi li sn phm v a ch m qu khch cung cp. Chi ph vn chuyn chiu gi li do BABU thanh ton</p><p><strong>B. Nhng trng hp sau khng c bo hnh:</strong></p><p>- Cc sn phm khng cn nguyn tem nim phong, tem QC, c hin tng b tho ri  t  can thip vo kt cu bn trong ca sn phm.</p><p>- S dng ngun sc in trc tip i vi cc thit b khng dy, dn ti hng hc linh kin v chc nng s dng pin ca bn phm</p><p>- H hng do tc ng vt l ca ngi tiu dng nh ri v, va chm, vo nc, m thp, chp chy.</p><p>- H hng do thin tai, ng vt, cng trng v do con ngi gy ra;</p><p>- Hin tng r st do yu t thi tit,  m, thi quen ngi dng u khng c bo hnh;</p><p>- Ht thi hn bo hnh k t ngy nhn c hng;</p><p>- Khch hng t  can thip vo firmware ca sn phm.</p><p><strong>C. Cc trng hp khc s c bo hnh theo tiu chun ca nh sn xut.</strong></p><p>- C th vi bn phm c s c bo hnh cc li pht sinh do nh sn xut m khng phi do ngi dng: Hng mch, cht led, li kt ni.</p><p>- Cc sn phm khng s dng in nh Keycap, Switch, Keypuller, Swich Puller, Lube Station... u khng bo hnh</p>', '<p><strong>1. Mc ch v phm vi thu thp</strong></p><p>Cm n Qu khch  truy cp vo website ca chng ti,  s dng dch v ti website, Qu khch c th c yu cu ng k thng tin c nhn vi chng ti nh:</p><p>- H v tn, a ch lin lc</p><p>- Email, s in thoi di dng</p><p>Chng ti cng c th thu thp thng tin v s ln ving thm website ca chng ti bao gm s trang Qu khch xem, s links Qu khch click v cc thng tin khc lin quan n vic kt ni n a ch ch thebabustore.vn</p><p><strong>2. Phm vi s dng thng tin</strong></p><p>thebabustore.vn thu thp v s dng thng tin c nhn vi mc ch ph hp v hon ton tun th chnh sch bo mt ny. Chng ti ch s dng thng tin ca Qu khch trong ni b cng ty hoc c th cng b cho bn th 3 nh cc i l, cc nh cung cp dch v khc nhm cung cp dch v tt nht, ti u nht cho Qu khch.</p><p>Khi cn thit chng ti c th s dng nhng thng tin ny  lin h trc tip vi Qu khch nh gi th ng, n t hng, th cm n, thn tin v k thut v bo mt, thng tin v khuyn mi, thng tin v sn phm dch v mi.</p><p><strong>3. Thi gian lu tr thng tin</strong></p><p>Cc thng tin ca Qu khch hng s c lu tr&nbsp; trong h thng ni b ca cng ty chng ti cho n khi Qu khch c yu cu hy b cc thng tin  cung cp.</p><p><strong>4. a ch ca n v th thp v qun l thng tin c nhn</strong></p><p>H Kinh Doanh The BaBu Store</p><p>a ch: 183 HT44 phng Hip Thnh Qun 12</p><p>in thoi: 0355.198.659</p><p><strong>5. Phng tin v cng c  ngi dng tip cn v chnh sa d liu c nhn</strong></p><p>Qu khch mun chnh sa thng tin c nhn ca mnh vui lng lin h tng i chm sc khch hng ca chng ti qua s in thoi:&nbsp; 0355.198.659 hoc qua a ch email: <a href=\"mailto:kicap.vn@gmail.com\"><span style=\"text-decoration: underline;\">kicap.vn@gmail.com</span></a></p><p><strong>6. Cam kt bo mt thng tin c nhn khch hng</strong></p><p>Chng ti cam kt bo mt thng tin ca Qu khch hng bng mi hnh thc c th theo chnh bo v thng tin c nhn ca chng ti.</p><p>Chng ti tuyt i khng chia s thng tin ca Qu khch cho bt c cng ty hay bn th 3 no khc ngoi tr cc i l v cc nh cung cp lin quan n vic cung cp dch v cho Qu khch hng.</p>', '<p>A. Chnh sch i hng</p><p>- The BABU ch h tr i hng trong trng hp sn phm ca qu khch c mua ti BABU v cn nguyn tem mac v hnh thc nh mi trong thi gian ti a 3 ngy k t khi nhn hng.</p><p>- i vi cc trng hp sn phm li (c video m hp khi nhn hng), BABUh tr i tr trc tip cho qu khch sn phm mi trong 15 ngy u tin s dng, ch p dng vi cc sn phm trong danh mc bo hnh. Tham kho chnh sch bo hnh ca BABU.</p><p>B. Chnh sch tr hng hon tin</p><p>- BABUh tr tr hng hon tin cho qu khch i vi bt c n hng no m qu khch khng hi lng v cht lng sn phm vi iu kin sn phm ca qu khch cn nguyn tem mc, cha ri v hay can thip vo bn trong phn cng v phm mm ca sn phm.</p><p>- Hnh thc hon tin: The BABU s chuyn khon li cho qu khch ngay khi nhn c hng.</p><p>- i vi cc n hng  xa, qu khch xin vui lng thanh ton ph vn chuyn khi gi tr hng li cho THE BABU.</p>', '<p>THE BABU STORE</p><p><br></p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image&quot;,&quot;height&quot;:240,&quot;url&quot;:&quot;http://localhost:8000/bizweb.dktcdn.net/thumb/medium/100/436/596/files/z2645819303628-d961c9e7739b7d89cc51db88ad9e94f6-cef7b3e6-2e49-4f7c-a53e-d0d933c58ec6.jpg?v=1631202888004&quot;,&quot;width&quot;:240}\" data-trix-content-type=\"image\" class=\"attachment attachment--preview\"><img src=\"http://localhost:8000/bizweb.dktcdn.net/thumb/medium/100/436/596/files/z2645819303628-d961c9e7739b7d89cc51db88ad9e94f6-cef7b3e6-2e49-4f7c-a53e-d0d933c58ec6.jpg?v=1631202888004\" width=\"240\" height=\"240\"><figcaption class=\"attachment__caption\"></figcaption></figure><br>&nbsp; &nbsp; &nbsp;<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image&quot;,&quot;height&quot;:600,&quot;url&quot;:&quot;http://localhost:8000/bizweb.dktcdn.net/thumb/grande/100/436/596/files/158795710-525043295127859-5240130807423059829-n.jpg?v=1631204621672&quot;,&quot;width&quot;:600}\" data-trix-content-type=\"image\" class=\"attachment attachment--preview\"><img src=\"http://localhost:8000/bizweb.dktcdn.net/thumb/grande/100/436/596/files/158795710-525043295127859-5240130807423059829-n.jpg?v=1631204621672\" width=\"600\" height=\"600\"><figcaption class=\"attachment__caption\"></figcaption></figure></p><p><br></p>', '<p>Webgiadung.com cung cp a dng sn phm tin ch v cht lng gip mang n cho bn cuc sng hin i. i ng kinh doanh giu kinh nghim lun sn sng t vn, cung cp cc Gii php Mua Sm hiu qu v tit kim chi ph cho qu khch.</p><p>Mi chi tit v gii p thc mc xin vui lng lin h li vi chng ti di y:</p><p>&nbsp;</p><p><strong>CNG TY TNHH SIU TH THNG MINH</strong><br>M s doanh nghip: 0110503197<br>S in thoi: 0832.216.580<br>a ch: Tng 12, Ta nh Licogi 13, S 164 ng Khut Duy Tin, Phng Nhn Chnh, Qun Thanh Xun, Thnh ph H Ni, Vit Nam<br>Email: infosieuthithongminh@gmail.com</p><p>&nbsp;</p><p><strong>Showroom bn hng</strong></p><p>Ca hng ti HN: 547 . Xun nh, Phng Xun nh, Qun Bc T Lim, TP. H Ni<br>Ca hng ti HCM: 555 Gia Ph, Phng 3, Qun 6, Thnh ph H Ch Minh<br>Hotline: 0832.216.580<br>Email: cskh@webgiadung.com<br>Website: https://webgiadung.com</p><p>Mi chi tit v gii p thc mc xin vui lng lin h li vi chng ti qua email: cskh@webgiadung.com</p>', NULL, '2024-10-08 19:52:13', '2024-11-18 15:47:49', '01JBZXMG82KVC4N8H881PF01HD.svg', '0355198659', 'mb', 'https://www.facebook.com/profile.php?id=100094627910502', 'zalo.me/84355198659', 'https://shopee.vn/thebabuofficial?entryPoint=ShopBySearch&searchKeyword=the%20babu', 'https://zalo.me/84355198659', '01JBZXVQSCQ4FQKS7S8YB2Z6N3.svg', '183 HT44 phng Hip Thnh Qun 12', NULL, '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d23014.03809380152!2d106.6216783372892!3d10.881387527047286!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x317529abda308eb7%3A0x7ceee7f51695bd2!2zVGhlIEJBQlUgU3RvcmUgLSBjaHV5w6puIGLDoW4gYsOgbiBwaMOtbSBjxqEgY3Vzd